export class AverageSessionModel {
	constructor(data) {
		this.id = data.userId;
		this.sessions = data.sessions;
	}

	getAverage() {
		const datas = this.sessions.map((session) => {
			if (session.day === 0) {
				return 'lundi';
			}
		});
		return datas;
